import React from 'react';
import { motion, useInView } from 'framer-motion';
import { useRef } from 'react';
import portfolioImage from '../assets/149400531_2863964833880191_365399902058522801_n-removebg-preview.png';

const About = () => {
  const stats = [
    { number: '20+', label: 'Projects Completed', icon: 'fas fa-code' },
    { number: '6+', label: 'Months Experience', icon: 'fas fa-calendar-alt' },
    { number: '100', label: 'Happy Clients', icon: 'fas fa-users' }
  ];

  return (
    <section className="py-20 px-4 relative overflow-hidden bg-gradient-to-br from-gray-50 to-blue-50 dark:from-background-dark dark:to-gray-900" id="about">
      {/* Background Elements */}
      <div className="absolute top-0 right-0 w-96 h-96 bg-primary/10 rounded-full blur-3xl -z-10 transform translate-x-1/2 -translate-y-1/2"></div>
      <div className="absolute bottom-0 left-0 w-64 h-64 bg-secondary/10 rounded-full blur-3xl -z-10 transform -translate-x-1/2 translate-y-1/2"></div>
      
      <div className="max-w-6xl mx-auto">
        <div className="text-center mb-16">
          <h2 className="text-4xl md:text-5xl font-display font-bold mb-4">
            <span className="text-primary neon-text">About</span>{' '}
            <span className="text-secondary neon-text-pink">Me</span>
          </h2>
          <div className="h-1 w-24 bg-gradient-to-r from-primary to-secondary mx-auto rounded-full"></div>
          <p className="text-gray-500 dark:text-gray-400 mt-4 text-lg">
            Passionate developer on a journey to master full-stack development
          </p>
        </div>
        
        <div className="flex flex-col lg:flex-row items-center gap-12">
          {/* Text Content */}
          <div className="w-full lg:w-1/2 space-y-6">
            <div className="bg-white/80 dark:bg-card-dark/80 backdrop-blur-sm p-6 rounded-2xl border border-gray-200 dark:border-white/10 shadow-lg hover:shadow-xl transition-all duration-300">
              <p className="text-lg leading-relaxed text-gray-600 dark:text-gray-400">
                Hello, I am <span className="text-primary font-semibold">Rifat</span> ‚Äì an enthusiastic student, 
                currently taking Programming Hero's Level 1 course and on my way to becoming a full-stack web developer. 
                I practice coding regularly every day, try to learn something new, and gradually improve my skills.
              </p>
            </div>
            
            <div className="bg-white/80 dark:bg-card-dark/80 backdrop-blur-sm p-6 rounded-2xl border border-gray-200 dark:border-white/10 shadow-lg hover:shadow-xl transition-all duration-300">
              <p className="text-lg leading-relaxed text-gray-600 dark:text-gray-400">
                I am now almost at the end of the course and am more confident than ever. I believe that anything is 
                possible with hard work, patience and confidence. I know that one day in the future I will definitely 
                become a skilled and successful <span className="text-secondary font-semibold">MERN Stack Developer</span>. 
                InshaAllah üòäüëç
              </p>
            </div>
            
            {/* Stats Grid */}
            <div className="grid grid-cols-1 sm:grid-cols-3 gap-4 pt-6">
              {stats.map((stat, index) => (
                <div 
                  key={index}
                  className="bg-white dark:bg-card-dark p-6 rounded-xl border border-gray-200 dark:border-white/10 text-center shadow-lg hover:border-primary/50 transition-all duration-300 group hover:scale-105 transform"
                >
                  <div className="text-primary mb-3 group-hover:scale-110 transition-transform">
                    <i className={`${stat.icon} text-2xl`}></i>
                  </div>
                  <h3 className="text-3xl font-display font-bold text-primary mb-1 group-hover:text-secondary transition-colors">
                    {stat.number}
                  </h3>
                  <p className="text-xs uppercase tracking-wider text-gray-500 font-bold">
                    {stat.label}
                  </p>
                </div>
              ))}
            </div>
          </div>
          
          {/* Visual Element */}
          <div className="w-full lg:w-1/2 flex justify-center relative">
            <div className="relative w-80 h-80">
              {/* Animated Rings */}
              <div className="absolute inset-0 border-2 border-primary/30 rounded-full transform rotate-45 scale-110 animate-pulse-slow"></div>
              <div className="absolute inset-0 border-2 border-secondary/30 rounded-full transform -rotate-12 scale-90 animate-pulse-slow" style={{animationDelay: '1s'}}></div>
              <div className="absolute inset-0 border-2 border-purple-500/30 rounded-full transform rotate-12 scale-125 animate-pulse-slow" style={{animationDelay: '2s'}}></div>
              
              {/* Center Glow */}
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-24 h-24 bg-gradient-to-br from-primary to-secondary rounded-full blur-md opacity-50 animate-pulse"></div>
              
              {/* Profile Image */}
              <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 w-64 h-64 rounded-full overflow-hidden border-4 border-white/20 shadow-2xl bg-gradient-to-br from-primary/20 to-secondary/20">
                <img 
                  alt="Rifat - Full Stack Developer Portfolio" 
                  className="w-full h-full object-cover object-center opacity-90 hover:opacity-100 transition-all duration-300 hover:scale-105 transform" 
                  src={portfolioImage}
                  onError={(e) => {
                    e.target.style.display = 'none';
                    console.log('Image failed to load');
                  }}
                />
                {/* Overlay gradient for better integration */}
                <div className="absolute inset-0 bg-gradient-to-t from-primary/10 via-transparent to-secondary/10 opacity-30"></div>
              </div>
              
              {/* Floating Tech Icons */}
              <div className="absolute top-4 right-4 text-2xl text-primary animate-float">
                <i className="fab fa-react"></i>
              </div>
              <div className="absolute bottom-4 left-4 text-2xl text-green-500 animate-float" style={{animationDelay: '1s'}}>
                <i className="fab fa-node-js"></i>
              </div>
              <div className="absolute top-1/2 right-0 text-2xl text-yellow-400 animate-float" style={{animationDelay: '2s'}}>
                <i className="fab fa-js"></i>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default About;
